import { Header, Hero, Sidebar } from './components';

const App = () => {
  return (
    <Box sx={{backgroundColor: '#D3D3D3'}}>
      <Header/>
      <Sidebar/>
      <Hero/>
    </Box>
  )
}

export default App;
